import React from 'react';

export const AddSong = (props)=>{
    return(
        <div>
            <h3>Enter your favourite artist/singer</h3>
            <form onSubmit = {props.add}>
            <input type="text"/>
            <button>Search</button>
            </form>
        </div>
    )
}
